import { Link } from "react-router-dom";
import logoimg from "../assets/img/logo.jpg";

function Navbar() {
  return (
    <nav className="bg-[#111] p-4">
      <div className="container mx-auto flex justify-between items-center">
      
      <Link to="/home"> {/* Wrap logo in a Link to make it clickable */}
        <img
          id="logo-about"  // Same ID for the breathing effect
          src={logoimg}
          alt="Logo"
          className="w-48 h-48 sm:w-56 sm:h-56 md:w-64 md:h-64 lg:w-80 lg:h-80 rounded-full mb-8 md:mb-0"
        />
      </Link>

        {/* Menu */}
        <div className="hidden md:flex space-x-6">
          <Link to="/" className="text-white">Home</Link>
          <Link to="/portfolio" className="text-white">Portfolio</Link>
          <Link to="/projects" className="text-white">Projects</Link>
          <Link to="/team" className="text-white">Team</Link>
          <Link to="/contact" className="text-white">Contact</Link>
        </div>

        {/* Hamburger menu for mobile */}
        <div className="md:hidden">
          <button className="text-white">â˜°</button>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
